  JHADFIELD, Alexander Charles Fulford and ALTMAYER, Ann Elizabeth
  01> HADFIELD, Amelia Ann Elizabeth (Amy)
  b 24.02.1975
  02> HADFIELD, Mary Ann Elizabeth
  b 01.03.1978
  03> HADFIELD, Elizabeth Rose
  b 27.06.1981
  02> HADFIELD, Alice Mary Caroline (Molly) m on 21.08.1971 to SWITEK, Evek
  b 31.03.1950
  b 28.03.1931
  Address: 8 Crossley Street, London, N7 8PD, England.
  08>' HADFIELD, Ernest Frederick m on 27.12.1902 to WOOD, Ada Mary Louise
  b 09.08.1866 d 04.06.1946
  b 19.02.1878 d 06.03.1939
  Ernest b. at Otaki, Ernest was educated in England and graduated from Cambridge University. He was a
  barrister and solicitor in Wellington and Chancellor of the Wellington Diocese of the Anglican Church.
  01> HADFIELD, Ernestine Miriam
  b 08.12.1903 d 03.01.1959
  Ernestine b. at Wellington. She was educated at Marsden School (Dux) and Victoria University College (MA)
  and went on to study in France. She taught for many years on the staff of the Correspondence School in
  Wellington.
  02> HADFIELD, Dorothy m on 15.09.1931 to ZOHRAB, John Fortescue
  b 15.02.1905 d 06.01.1992
  b 19.09.1902 d 30.08.1959
  Dorothy b, at Wellington, m, at St Paul's Pro-Cathedral, Wellington and d. at Catherine Armstrong Hospital,
  Taupo.
  Dorothy was educated at Marsden School (Dux) and Victoria University College (BA). Her great interest was
  embroidery and she was the inaugural President of the Wellington Embroiders Guild. She was for many years
  Sacristan of the Wellington Cathedral.
  John, MBCHB, FRCS(Edin) was a general practitioner/ surgeon in Wellington. He was educated at Wellington
  College and Otago Medical School, with post graduate study in Edinburgh.
  01> ZOHRAB, Edith Mary m on 02.02.1957 to HARDIE BOYS, Michael
  b 01.04.1933
  b 06.10.1931
  Mary b. at Wellington and m. at the Cathedral Church of St Paul, Wellington, Michael, s/o Hon Mr
  Justice Reginald Hardie Boys and Edith May Bennett, b. at Wellington. Address: Government House,
  Private Bag, Wellington.
  Mary was educated at Marsden School (Head Girl) and Canterbury School of Art, Christchurch (DipFA). She
  continues to enjoy painting and exhibits in New Zealand.
  Michael was educated at Wellington College and studied law at Victoria University. He was a Judge of
  the Court of Appeal and is a Privy Councillor. He was created GCMG in 1995 and GNZM in 1996. He was
  sworn in as New Zealand's 17th Governor General on 21 March 1996.
  01> HARDIE BOYS, Deryn Mary
  b 17.12.1957
  Deryn b. at Wellington. Address: 25 High Street, Island Bay, Wellington,
  Deryn attended Marsden College and gained a BSc in Physiology at Otago University then attended
  Christchurch Teachers' Training College. She completed a DipTESL at Victoria University in 1993
  and has been teaching English as a second language both in New Zealand and overseas.
